script: |
  super -f text -I q11400.spq | sort > q11400.out

inputs:
  - name: q11400.spq
    data: |
      SELECT + 74 / - + ( col0 ) + - col0 + + col2 + - - col0 * + col1 * + + 52 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 IS NULL;
  - name: tab1

outputs:
  - name: q11400.out
    data: |
      22074
      222381
      37172
